import logo from './logo.svg';
import './App.css';
import AppHeader from "./components/AppHeader";
import Home from './pages/Home/Home'
import {BrowserRouter} from 'react-router-dom';

function App() {
    let isAuth = true

    return (
        <BrowserRouter>
            <div className='App'>
                <AppHeader isAuth={isAuth}/>
                <div className='container'>
                    <Home/>
                </div>

            </div>
        </BrowserRouter>
    );
}

export default App;
